import React, { useState, useEffect } from "react";
import axios from "axios";
import {
  Container,
  TextField,
  Button,
  MenuItem,
  Typography,
} from "@mui/material";
import { useNavigate } from "react-router-dom";

const CreateTaskPage = () => {
  const [applications, setApplications] = useState([]);
  const [sqiPics, setSqiPics] = useState([]);
  const [form, setForm] = useState({
    title: "",
    supportType: "",
    customSupportType: "",
    description: "",
    applicationId: "",
    sqiPicId: "",
  });

  const navigate = useNavigate();

  // ðŸ”¹ Ambil data dari API
  useEffect(() => {
    const fetchData = async () => {
      const [appRes, picRes] = await Promise.all([
        axios.get("http://localhost:4000/api/applications"),
        axios.get("http://localhost:4000/api/sqi-pics"),
      ]);
      setApplications(appRes.data);
      setSqiPics(picRes.data);
    };
    fetchData();
  }, []);

  // ðŸ”¹ Daftar opsi support type
  const supportTypes = [
    "Support Review Code UAT",
    "Support Rollout Pod UAT / Regresi",
    "Support Re-base Gitlab UAT / Regresi",
    "Request Slot UAT / Regresi",
    "Support Query UAT dan Regresi",
    "Request support implementasi",
    "Request open port",
    "Request pengadaan server",
    "Other",
  ];

  // ðŸ”¹ Handle perubahan input
  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  // ðŸ”¹ Submit data ke backend
  const handleSubmit = async (e) => {
    e.preventDefault();

    // kalau user pilih Other â†’ pakai customSupportType
    const finalSupportType =
      form.supportType === "Other" ? form.customSupportType : form.supportType;

    await axios.post("http://localhost:4000/api/tasks", {
      title: form.title, // âœ… sudah dikembalikan!
      description: form.description,
      applicationId: form.applicationId,
      sqiPicId: form.sqiPicId,
      supportType: finalSupportType,
    });

    navigate("/"); // kembali ke halaman utama
  };

  return (
    <Container maxWidth="sm" sx={{ mt: 5 }}>
      <Typography variant="h5" gutterBottom>
        Tambah Task Baru
      </Typography>

      <form onSubmit={handleSubmit}>
        {/* âœ… 1. Judul Task */}
        <TextField
          fullWidth
          label="Judul Task"
          name="title"
          value={form.title}
          onChange={handleChange}
          margin="normal"
          required
        />

        {/* âœ… 2. Bentuk Support Type */}
        <TextField
          select
          fullWidth
          label="Bentuk Support"
          name="supportType"
          value={form.supportType}
          onChange={handleChange}
          margin="normal"
          required
        >
          {supportTypes.map((type, index) => (
            <MenuItem key={index} value={type}>
              {type}
            </MenuItem>
          ))}
        </TextField>

        {/* Jika user pilih "Other", tampilkan input tambahan */}
        {form.supportType === "Other" && (
          <TextField
            fullWidth
            label="Custom Support Type"
            name="customSupportType"
            value={form.customSupportType}
            onChange={handleChange}
            margin="normal"
            required
          />
        )}

        {/* âœ… 3. Aplikasi */}
        <TextField
          select
          fullWidth
          label="Aplikasi"
          name="applicationId"
          value={form.applicationId}
          onChange={handleChange}
          margin="normal"
          required
        >
          {applications.map((app) => (
            <MenuItem key={app.id} value={app.id}>
              {app.name}
            </MenuItem>
          ))}
        </TextField>

        {/* âœ… 4. Deskripsi */}
        <TextField
          fullWidth
          label="Deskripsi"
          name="description"
          value={form.description}
          onChange={handleChange}
          margin="normal"
          multiline
          rows={3}
          required
        />

        {/* âœ… 5. PIC SQI */}
        <TextField
          select
          fullWidth
          label="PIC SQI"
          name="sqiPicId"
          value={form.sqiPicId}
          onChange={handleChange}
          margin="normal"
          required
        >
          {sqiPics.map((pic) => (
            <MenuItem key={pic.id} value={pic.id}>
              {pic.name}
            </MenuItem>
          ))}
        </TextField>

        <Button type="submit" variant="contained" color="primary" sx={{ mt: 2 }}>
          Simpan Task
        </Button>
      </form>
    </Container>
  );
};

export default CreateTaskPage;
